import React from 'react';
import AboutHeader from './AboutHeader';
import Personal from './Personal';
import styled from 'styled-components';

const SpaceNeedleBackground = styled.div`
    background: url(data:image/png;base64,%2F9j%2F4AAQSkZJRgABAQAAAQABAAD%2F2wBDAAgGBgcGBQgHBwcâ€¦lFMr0y0zKa%2BvxSdaN9NYpKm2K%2BKwVNJrNJCzlZroumyaSswWZRTLTLTNZm46OX%2F9k%3D) center center no-repeat;
    background-size: cover;
    width: 100%;
    height: 100%;
    position: absolute;
    filter: brightness(120%) grayscale(100%);
    opacity: .1;
`;

const AboutPage = () => {

    return (
        <>
            <SpaceNeedleBackground/>
            <AboutHeader/>
            <Personal/>
        </>
    )
}

export default AboutPage
